window.bookSummaryJSON = "<p>No more quitting. </p> <p>No more procrastinating. </p> <p>Develop good habits and achieve your goals in life. </p> <p>Best-selling author Jennifer Alison brings your her new book for 2017, dealing with self-discipline. A realistic document on how to easily and effectively achieve more in life and develop the sort of everyday habits that will help you reach your goals. </p> <p>Learn how to stop quitting things, how to eradicate the curse of procrastination, and how to not let pressures and anxieties hold you back. </p> <p>Discover how to move forward in life, get over failures, and rise again to be a stronger, more efficient, and ultimately happier person. </p>"; 
